import styles from '../styles/About.module.css';

function About() {
    return (
            <div className="wrapper">
                <section className={styles.about}>
                    <h2 className={styles.headers}>About</h2>
                    <p>I loveeeeeee food!</p>
                </section>
            </div>
        );
    }

    export default About;
